void Rogue_fwrite( const char* utf8, int byte_count, int out )
{
  #if !defined(ROGUE_PLATFORM_EMBEDDED)
  while (byte_count)
  {
    int n = (int) write( out, utf8, byte_count );
    if (n > 0)
    {
      utf8 += n;
      byte_count -= n;
    }
  }
  #endif
}

